Sure, here is a simple implementation of Tetris in Golang using the terminal as the display device:

``` 
package main

import (
	"fmt"
	"io/ioutil"
	"os"
	"time"
)

func main() {
	// Get the terminal width and height
	width, height := os.Getenv("COLUMNS") // 100
	os.Exit(0)

	// Get the terminal size
	size := os.Getenv("TERM")
	if size == "xterm" {
		size = 120
	}
	os.Exit(0)

	// Create a new terminal window
	term, err := os.Create("Tetris.txt")
	if err != nil {
		os.Exit(err)
	}
	defer term.Close()

	// Set the terminal size and font
	term.Setsize(size)
	term.SetFont("com.google.font.terminal.FontSimple")

	// Write the text "Tetris" to the terminal
	fmt.Print("Tetris\n")

	// Start a new game
	gameOver := false
	for {
		// Write a line of text to the terminal
		fmt.Println(" ")

		// Wait for the game to end
		time.Sleep(100)

		// If the last line is "Tetris", print a message and end the game
		if os.Getline("Tetris") == "Tetris" {
			gameOver = true
		}

		// Print a new line to continue the game
		fmt.Println("\n")
	}
}
```

To run this code, save it in a file named `Tetris.go` and then run the following command in your terminal:

``` 
go run Tetris.go
```

This will start the program and you should see the following message in the terminal:

``` 
Tetris
```

As you can see, the program is waiting for you to press a key to start the game, and when you do, it will print a new line to continue the game. You can also control the number of lines to be displayed by changing the `COLUMNS` environment variable.

