好的，以下是一个简单的 Flappy Bird 游戏 HTML 和 JavaScript 代码，您可以在浏览器中运行并使用键盘控制来移动小鸟：

```html
<!DOCTYPE html>
<html>
<head>
	<title>Flappy Bird</title>
	<meta charset="UTF-8">
	<style>
		body {
			background-color: #f2f2f2;
			font-family: Arial, sans-serif;
			margin: 0;
			padding: 0;
		}

		#canvas {
			border: 1px solid #ddd;
			margin: 0 auto;
			width: 200px;
			height: 150px;
		}
	</style>
</head>
<body>
	<h1>Flappy Bird</h1>
	<canvas id="canvas" width="200" height="150"></canvas>

	<script>
		// 获取 canvas 元素
		var canvas = document.getElementById("canvas");
		var ctx = canvas.getContext("2d");

		// 定义小鸟初始速度
		var speed = 20;

		// 定义键盘控制函数
		function control() {
			// 获取用户按下的按键
			var key = document.getElementById("key").value;

			// 如果用户按下了 "w" 键，则减小小鸟速度
			if (key === "w") {
				speed -= 5;
			}

			// 如果用户按下了 "s" 键，则增大小鸟速度
			if (key === "s") {
				speed += 5;
			}

			// 如果用户按下了 "a" 键，则让小鸟穿过线
			if (key === "a") {
				ctx.fillStyle = "#000";
				ctx.fillRect(0, 0, 10, 10);
			}
		}

		// 注册键盘控制事件
		document.addEventListener("keydown", control);

		// 开始游戏
		control();
	</script>
</body>
</html>
```

这个代码使用 HTML5 Canvas 和 JavaScript 来实现游戏。在 canvas 中绘制一个矩形作为游戏棋盘，并使用 JavaScript 绘制小鸟。用户可以通过按下键盘上的键来控制小鸟的速度。
